import React from "react";

import { H2, H5, Text } from "@blueprintjs/core";

import { FormGroup, Input, InputProps } from "@mui/material";
import ButtonLogin from "../common/buttonLogin";

const ariaLabel = { "aria-label": "description" };

const Login = () => {
  return (
    <div>
      <H2>Login</H2>
      <br />

      <form className="login-from">
        <FormGroup label="Email" labelFor="text-input" labelInfo="(required)">
          <Input type="text" name="Email" />
        </FormGroup>
      </form>
      <Input defaultValue="Email Address" inputProps={ariaLabel} />
      <Input placeholder="Placeholder" inputProps={ariaLabel} />
      <Input disabled defaultValue="Disabled" inputProps={ariaLabel} />
      <Input defaultValue="Error" error inputProps={ariaLabel} />
      <ButtonLogin />
    </div>
  );
};
export default Login;
